insert  into `field_data_body`(`entity_type`,`bundle`,`deleted`,`entity_id`,`revision_id`,`language`,`delta`,`body_value`,`body_summary`,`body_format`) values ('node','article',0,10,10,'und',0,'Make in India is a campaign launched by the PM, Narendra Modi, which facilitates all the big business investors worldwide who want to do business in India. This programme was launched in 2014 on 25th of September by the PM at the Vigyan Bhawan in New Delhi. It is a big step taken by the government of India to reduce the level of unemployment faced by the youths of the country. This campaign was launched a day after the Mars mission when PM was to go on his first visit to the USA as prime minister of India.\r\nThe aim of launching this campaign in India is to make India a world level manufacturing powerhouse which will definitely help in solving the biggest issue of Indian economy. This initiative was launched with new deals for foreign investors successfully in New Delhi with the top industrialists of India including Mukesh Ambani (Reliance Industries chairman), Azim Premji (Wipro chairman), etc.','','filtered_html');
